import {
    Form,
    Link,
    useActionData,
    useNavigation,
    useSearchParams,
  } from "react-router-dom";
import classes from "./AuthForm.module.css";

import {FaBars, FaTimes} from "react-icons/fa"
import { useRef } from "react";

const MenuStructure = () => {
const navRef=useRef();
const showNavbar=()=>{
  navRef.current.classList.toggle("responsive_nav");
}

return (
<header>
    <h3>Logo</h3>
    <nav ref={navRef}>
        <a href="/#">Profile</a>
        <a href="/#">Language</a>
        <a href="/#">Help</a>
        <a href="/#">Logout</a>
        <a href="/#">About us</a>
        <button class="button_close" onClick={showNavbar}>
            <FaTimes/>

        </button>
    </nav>
    <button class="button_open" onClick={showNavbar}>
        <FaBars/>
    </button>
</header>

)
}

export default MenuStructure;
